function checkForRepeatsTwoD(array) {
    for (var i = 0; i < array.length; i++) {
        for (var j = 1; j < array[i].length; j++) {
            for (var k = (i + 1); k < array.length; k++) {
                if (array[i][j] === array[k][0]) {
                    console.log("spliced array at ", i, " at ", j, " because it conflicts with array at ", k, " at 0 ", array[i][j], " ", array[k][0], " used to be: ", array[i][0]);
                    array[i].splice(j, 1);
                    j--;
                }
            }
        }
    }
    for (var i = array.length - 1; i > -1; i--) {
        for (var j = 1; j < array[i].length; j++) {
            for (var k = (i - 1); k > -1; k--) {
                if (array[i][j] === array[k][0]) {
                    console.log("spliced array at ", i, " at ", j, " because it conflicts with array at ", k, " at 0 ", array[i][j], " ", array[k][0], " used to be: ", array[i][0]);
                    array[i].splice(j, 1);
                    j--;
                }
            }
        }
    }
    console.log("In checkForRepeatsTwoD done again: ", array);
    return array;
};

