function binarySearch(length, nStart, nEnd) {
    var nMiddle = parseInt((nStart + nEnd) / 2) + 1;
    if (arsWordLengths[nMiddle] === length) {
        bFound = true;
        return nMiddle;
    } else if (nStart >= nEnd) {
        bFound = false;
        return nStart;
    } else if (arsWordLengths[nMiddle] > length) {
        return binarySearch(length, nStart, nMiddle);
    } else if (arsWordLengths[nMiddle] < length) {
        return binarySearch(length, nMiddle, nEnd);
    }

};


